import React, {useState} from 'react';
import './App.css';
import Props from 'pages/props';

function App() {
  const [number, setNumber] = useState(1);

  return (
    <div className="App">
      <h1>Root : {number}</h1>
      <Props 
        number = {number}
        onIncrease = {() => {
          setNumber(number +1);
        }}
      />
    </div>
  );
}

export default App;
